  "advertisements": [
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "16. Bcy Hrn. Rudolf Ramperger an der Huthgas ist extra guter holländer-Taback in bleyernen Pfund-Büchsen à 10 Baßen, wie auch guter St. Vincent à 3 ß. zu haben."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "17. Wo guter Art grosse Bohnen zum Seßen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor-Huth, mittelmässiger Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "19. Bey Hrn. Burkhardt zum Riesen sind extra neue grosse Italiänische Feigen, dito grosse Meertrauben mit und ohne Stiel, Haselnuß, dürre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "20. Zwölf Sack neuer Waißen in billigem Preis, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 63 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jezigen Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "22. Zwey saubere französishe Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich, sind unentgeldtlich im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "23. Eine Behausung in der Reichemer Vorstadt mit 4 Stuben, 5 Kammern samt einer grosen Werkstatt, Estrig und einem schönen gewölbten Keller und Garten, weshalb sich bey Hrn. Jacob Mägdin dem Weinmann anzu melden."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "24. Ein Freund, welcher circa 600 Sester Hanf-Saamen anders liefern könte, möchte aber solchen vorhero verkauft wißen, offeriert selbigen dahero in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küefer zu vernehmen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "26. Circa 6 Saum extra guter alter pur rother Pößteiner-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "27. Zwey Stücklein weissen Wein von 1756. à 8 Pfund 10 ß der Saum im einen, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "28. Ein Stock Heu ab 3 Thänen Matten vorm Riecjemer Thor oberhalb der Schorendruck. Ferner ein Stücklein von 17 Saumen rothen Völliger-Wein von 1760. schön roth und lauter, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "29. Auf E. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "31. Im Offenburger-Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "32. Ein Brennhäußlein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piccenweis wegen Mangel Plaßes, wie auch roth und weisser 1753iger Margräser-Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "34. Keine heitergelbe hamburger Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "35. Herrn Hofzach des Siegrists Behausung im Spieg-häßlein mit 4 Stuben, 3 Kammern &c. ist entweder zu verkaufen, oder samethaft zu verleihcn."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "36. Weisse und rothe Margräser-Weine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "37. Ein Mannensiz in St. Peters Kirch auf dem Leitner. Item ein grün Tombeau-Bettlein mit grünen wollenen Umhängen, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "38. Ein Hausschüitten mit einem schönen Bild und Zugehördt in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1765-01-01",
      "tags_section": "Es werden zum Verkauff offeriert",
      "text": "39. Der Bärenseßer-Hof zu St. Peter, mit Garten, Stallung, Keller &c. wie der Augenschein zeigen wird. In Ermanglung eines Käufers"
    }
  ]
}

